Console.WriteLine(s.PossibleStringCount("", 1971));

public class Solution
{
    public int PossibleStringCount(string word, int k)
    {

        int mod = 1_000_000_007;
        List<int> RunLengths = new List<int>();
        char prev = word[0];
        int count = 1;

        long totalPerms = 1;
        for (int i = 1; i < word.Length; i++)
        {
            if (prev == word[i])
            {
                count++;
            }
            else
            {
                prev = word[i];
                RunLengths.Add(count);
                totalPerms = (totalPerms * count)%mod;
                count = 1;
            }
        }
        RunLengths.Add(count);
        totalPerms = (totalPerms * count)%mod;


        int n = RunLengths.Count;
        int[,] dp = new int[n + 1, k];

        for (int j=0; j < k; j++)
        {
            dp[n,j] = 1;
        }

        for(int i = n - 1; i >= 0; i--)
        {
            for(int j = k -1 ; j >= 0; j--)
            {
                int ans = 0;
                for (int m = 0; m < RunLengths[i]; m++)
                {
                    int next = j + m + 1;
                    if (next >= k) break;
                    ans = (ans + dp[i + 1, next]) % mod;
                }
                dp[i,j] = ans;
            }
        }
        

        int invalid = dp[0, 0];
        
        return (int)((totalPerms - invalid + mod) % mod);

        
    }
}